import React from "react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import Container from 'react-bootstrap/Container';
import {

  FacebookShareButton,
  YoutubeShareButton,

  LinkedinShareButton,

  TwitterShareButton,

  WhatsappShareButton,

} from "react-share";
import {

  FacebookIcon,



  LinkedinIcon,
  YoutTbeIcon,

  TwitterIcon,

  WhatsappIcon,

} from "react-share";














const FooterPage = () => {
  return (
    <div    style={{backgroundColor: 'lightblue', height: '300px'}}>




          <Container>
  <Row>
    <Col sm={4}>First, but last</Col>
    <Col sm={4}>

    < FacebookShareButton    url={'https://twitter.com/'}  title={'fallow'}  >  


          <FacebookIcon size={32} round={true} />  </ FacebookShareButton> 

          < WhatsappShareButton    url={'https://twitter.com/'}  title={'fallow'}  >  


          <WhatsappIcon size={32} round={true} />  </ WhatsappShareButton> 
          < TwitterShareButton    url={'https://twitter.com/'}  title={'fallow'}  >  


          <TwitterIcon size={32} round={true} />  </ TwitterShareButton> 
          < LinkedinShareButton   url={'https://twitter.com/'}  title={'fallow'}  >  


          <LinkedinIcon size={32} round={true} />  </LinkedinShareButton> 


          < YoutubeShareButton   url={'https://twitter.com/'}  title={'fallow'}  >  


          <YoutubeIcon size={32} round={true} />  </YoutubeShareButton> 



    </Col>
    <Col sm={4}>Third, but first</Col>
  </Row>
</Container>









      </div>

  );
}

export default FooterPage;
